import{_ as e,c as t,o as r,a}from"./app.14440598.js";const b='{"title":"React Project Templates","description":"","frontmatter":{"slug":"templates-react","title":"React Project Templates"},"headers":[{"level":2,"title":"React .NET Core and .NET Framework Single Page App Templates","slug":"react-net-core-and-net-framework-single-page-app-templates"},{"level":3,"title":"React 16 SPA Template","slug":"react-16-spa-template"},{"level":3,"title":"React Desktop Apps Template","slug":"react-desktop-apps-template"},{"level":2,"title":"Gistlyn - a C# Gist IDE powered by Roslyn","slug":"gistlyn-a-c-gist-ide-powered-by-roslyn"},{"level":2,"title":"Web, Node.js and React Native ServerEvents Apps","slug":"web-node-js-and-react-native-serverevents-apps"},{"level":2,"title":"React Chat","slug":"react-chat"},{"level":3,"title":"Networked Time Traveller Shape Creator","slug":"networked-time-traveller-shape-creator"},{"level":2,"title":"Redis React","slug":"redis-react"},{"level":2,"title":"React Chat Desktop","slug":"react-chat-desktop"},{"level":2,"title":"React Desktop Apps","slug":"react-desktop-apps"}],"relativePath":"templates-react.md","lastUpdated":1634495308450}',o={},s=a(`<p><a href="https://reactjs.org" target="_blank" rel="noopener noreferrer">React</a> is a very popular JavaScript Library developed by Facebook to simplify creating complex UIs through use of declarative encapsulated components which can be used to build both Web and Native iOS/Android Applications with <a href="https://facebook.github.io/react-native/" target="_blank" rel="noopener noreferrer">React Native</a>.</p><h2 id="react-net-core-and-net-framework-single-page-app-templates" tabindex="-1">React .NET Core and .NET Framework Single Page App Templates <a class="header-anchor" href="#react-net-core-and-net-framework-single-page-app-templates" aria-hidden="true">#</a></h2><p>The templates below have been <a href="https://docs.servicestack.net/templates-single-page-apps#end-to-end-typed-apis" target="_blank" rel="noopener noreferrer">seamlessly integrated</a> into ServiceStack&#39;s <a href="/physical-project-structure.html">Recommended Physical Project Structure</a>.</p><p>See the documentation in each project for more info on features of each template:</p><h3 id="react-16-spa-template" tabindex="-1"><a href="https://github.com/NetCoreTemplates/react-spa" target="_blank" rel="noopener noreferrer">React 16 SPA Template</a> <a class="header-anchor" href="#react-16-spa-template" aria-hidden="true">#</a></h3><p>Bootstrapped with <a href="https://github.com/facebook/create-react-app" target="_blank" rel="noopener noreferrer">create-react-app</a>.</p><p><a href="https://github.com/NetCoreTemplates/react-spa" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/csharp-templates/react-spa.png" alt=""></a></p><blockquote><p>Live Demo: <a href="http://react-spa.web-templates.io" target="_blank" rel="noopener noreferrer">react-spa.web-templates.io</a></p></blockquote><p>Create new React 16 Project for .NET 5.0:</p><div class="language-bash"><pre><code>$ x new react-spa ProjectName
</code></pre></div><p>Create new React 16 Project for .NET Framework:</p><div class="language-bash"><pre><code>$ x new react-spa-netfx ProjectName
</code></pre></div><h3 id="react-desktop-apps-template" tabindex="-1"><a href="https://github.com/NetFrameworkTemplates/react-desktop-apps-netfx" target="_blank" rel="noopener noreferrer">React Desktop Apps Template</a> <a class="header-anchor" href="#react-desktop-apps-template" aria-hidden="true">#</a></h3><p>The React Desktop Template is a single VS .NET template which supports packaging your Web App into 4 different <a href="http://ASP.NET" target="_blank" rel="noopener noreferrer">ASP.NET</a>, Winforms, OSX Cocoa and cross-platform Console App Hosts:</p><p><a href="https://github.com/NetFrameworkTemplates/react-desktop-apps-netfx" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/csharp-templates/react-desktop-apps-netfx.png" alt=""></a></p><blockquote><p>Live Demo: <a href="http://react-desktop-apps-netfx.web-templates.io" target="_blank" rel="noopener noreferrer">react-desktop-apps-netfx.web-templates.io</a></p></blockquote><p>Create new React Project for .NET Framework:</p><div class="language-bash"><pre><code>$ x new react-desktop-apps-netfx ProjectName
</code></pre></div><h1 id="react-examples" tabindex="-1">React Examples <a class="header-anchor" href="#react-examples" aria-hidden="true">#</a></h1><h2 id="gistlyn-a-c-gist-ide-powered-by-roslyn" tabindex="-1"><a href="https://github.com/ServiceStack/Gistlyn" target="_blank" rel="noopener noreferrer">Gistlyn</a> - a C# Gist IDE powered by Roslyn <a class="header-anchor" href="#gistlyn-a-c-gist-ide-powered-by-roslyn" aria-hidden="true">#</a></h2><p>Gistlyn is the ultimate collaborative tool for trying out and exploring C# and .NET libraries on NuGet from a zero install - modern browser. It&#39;s ideal for use as a companion tool for trying out libraries during development or on the go from the comfort of your iPad by going to <a href="http://gistlyn.com" target="_blank" rel="noopener noreferrer">gistlyn.com</a>.</p><p><a href="http://gistlyn.com" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/livedemos/gistlyn/home-screenshot.png" alt=""></a></p><blockquote><p>Live Demo: <a href="http://gistlyn.com" target="_blank" rel="noopener noreferrer">gistlyn.com</a></p></blockquote><h2 id="web-node-js-and-react-native-serverevents-apps" tabindex="-1"><a href="https://github.com/ServiceStackApps/typescript-server-events" target="_blank" rel="noopener noreferrer">Web, Node.js and React Native ServerEvents Apps</a> <a class="header-anchor" href="#web-node-js-and-react-native-serverevents-apps" aria-hidden="true">#</a></h2><p>Using TypeScript ServerEvents Client to create real-time Web, node.js server and React Native Mobile Apps:</p><p><a href="https://github.com/ServiceStackApps/typescript-server-events" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/livedemos/typescript-serverevents/typescript-server-events-banner.png" alt=""></a></p><h2 id="react-chat" tabindex="-1"><a href="https://github.com/ServiceStackApps/ReactChat" target="_blank" rel="noopener noreferrer">React Chat</a> <a class="header-anchor" href="#react-chat" aria-hidden="true">#</a></h2><p>React Chat is a port of <a href="https://github.com/ServiceStackApps/Chat" target="_blank" rel="noopener noreferrer">ServiceStack Chat</a> ES5, jQuery Server Events demo into a <a href="http://www.typescriptlang.org/" target="_blank" rel="noopener noreferrer">TypeScript</a>, <a href="http://facebook.github.io/react/" target="_blank" rel="noopener noreferrer">React</a> and <a href="https://github.com/reactjs/redux" target="_blank" rel="noopener noreferrer">Redux</a> App:</p><p><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/livedemos/chat-react/screenshot.png" alt=""></p><p>Developed using the latest <a href="https://github.com/ServiceStackApps/typescript-react-template/" target="_blank" rel="noopener noreferrer">TypeScript + Redux + JSPM + Gulp</a> <a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> Template</p><h3 id="networked-time-traveller-shape-creator" tabindex="-1"><a href="https://github.com/ServiceStackApps/typescript-redux#example-9---real-time-networked-time-traveller" target="_blank" rel="noopener noreferrer">Networked Time Traveller Shape Creator</a> <a class="header-anchor" href="#networked-time-traveller-shape-creator" aria-hidden="true">#</a></h3><p>A network-enhanced version of the <a href="https://github.com/ServiceStackApps/typescript-redux#example-8---time-travelling-using-state-snapshots" target="_blank" rel="noopener noreferrer">stand-alone Time Traveller Shape Creator</a> that allows users to <strong>connect to</strong> and <strong>watch</strong> other users using the App in real-time similar to how users can use Remote Desktop to watch another computer&#39;s screen:</p><p><a href="http://redux.servicestack.net" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/livedemos/redux-chrome-safari.png" alt=""></a></p><blockquote><p>Live demo: <a href="http://redux.servicestack.net" target="_blank" rel="noopener noreferrer">http://redux.servicestack.net</a></p></blockquote><p>The client code required to enable real-time communication is encapsulated within a single <a href="https://github.com/ServiceStackApps/typescript-redux/blob/master/src/TypeScriptRedux/src/example09/Connect.tsx" target="_blank" rel="noopener noreferrer">React Connect component</a> whilst the server implementation is only comprised of <a href="https://github.com/ServiceStackApps/typescript-redux/blob/master/src/TypeScriptRedux/Global.asax.cs" target="_blank" rel="noopener noreferrer">2 simple Server Event Services</a> that lets users publish their actions to a channel or send a direct message to another User.</p><h2 id="redis-react" tabindex="-1"><a href="https://github.com/ServiceStackApps/RedisReact" target="_blank" rel="noopener noreferrer">Redis React</a> <a class="header-anchor" href="#redis-react" aria-hidden="true">#</a></h2><p>Redis React is a simple user-friendly UI for browsing data in Redis servers that leverages the navigation and deep-linking benefits of a Web-based UI, the productivity and responsiveness of the <a href="http://facebook.github.io/react/" target="_blank" rel="noopener noreferrer">React framework</a> and deep Integration possible from a Native App.</p><p><a href="http://redisreact.servicestack.net/#/" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/livedemos/redis-react/home.png" alt=""></a></p><p><a href="http://redisreact.servicestack.net/#/" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/livedemos/redis-react/home.png" alt=""></a></p><blockquote><p>Downloads for <a href="https://github.com/ServiceStackApps/RedisReact#download" target="_blank" rel="noopener noreferrer">Windows, OSX, Linux and Web</a></p></blockquote><h2 id="react-chat-desktop" tabindex="-1"><a href="https://github.com/ServiceStackApps/ReactChatApps" target="_blank" rel="noopener noreferrer">React Chat Desktop</a> <a class="header-anchor" href="#react-chat-desktop" aria-hidden="true">#</a></h2><p>A port of <a href="https://github.com/ServiceStackApps/Chat-React" target="_blank" rel="noopener noreferrer">React Chat</a> built with the new <a href="https://github.com/ServiceStackApps/ReactDesktopApps" target="_blank" rel="noopener noreferrer">React Desktop Apps</a><a href="http://VS.NET" target="_blank" rel="noopener noreferrer">VS.NET</a> template and packaged into a native Desktop App for Windows and OSX. It takes advantage of <a href="https://github.com/ServiceStack/ServiceStack/wiki/Server-Events" target="_blank" rel="noopener noreferrer">Server Events</a> to enable synchronized real-time control of multiple Windows Apps:</p><p><a href="https://youtu.be/-9kVqdPbqOM" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/livedemos/react-desktop-apps/dancing-windows.png" alt=""></a></p><blockquote><p>Downloads for <a href="https://github.com/ServiceStackApps/ReactChatApps#downloads" target="_blank" rel="noopener noreferrer">Windows, OSX, Linux and Web</a></p></blockquote><h2 id="react-desktop-apps" tabindex="-1"><a href="https://github.com/ServiceStackApps/ReactDesktopApps" target="_blank" rel="noopener noreferrer">React Desktop Apps</a> <a class="header-anchor" href="#react-desktop-apps" aria-hidden="true">#</a></h2><p>React Desktop Apps take advantage of the adaptability, navigation and deep-linking benefits of a Web-based UI, the productivity and responsiveness of the <a href="https://facebook.github.io/react/" target="_blank" rel="noopener noreferrer">React framework</a>, the performance, rich features and functionality contained in <a href="https://github.com/ServiceStack/ServiceStack/wiki" target="_blank" rel="noopener noreferrer">ServiceStack</a> and the .NET Framework combined with the native experience and OS Integration possible from a Native Desktop App - all within a single VS .NET template!</p><p><a href="https://github.com/ServiceStackApps/ReactDesktopApps" target="_blank" rel="noopener noreferrer"><img src="https://raw.githubusercontent.com/ServiceStack/Assets/master/img/gap/react-desktop-splash.png" alt="React Desktop Apps"></a></p><blockquote><p>Downloads for <a href="https://github.com/ServiceStackApps/ReactDesktopApps#downloads" target="_blank" rel="noopener noreferrer">Windows, OSX, Linux and Web</a></p></blockquote>`,48),p=[s];function n(c,i,l,h,d,m){return r(),t("div",null,p)}var f=e(o,[["render",n]]);export{b as __pageData,f as default};
